Step-by-step reasoning:

1. Key psychological mechanisms: We assume that, as proposers, individuals want to maximize their monetary reward (their share of the combined earning) but are also guided by an internalized fairness norm. This fairness norm weighs the “fair” division relative to one’s own contribution (determined by token_self relative to the total tokens). When a proposer offers a self‐share that deviates from this fairness ideal, they incur a psychological “cost.”

2. Interaction of mechanisms: The proposer’s utility should increase with the amount of money they receive (monetary reward) but be diminished by an increasing penalty as the deviation between the actual monetary share and the fairness ideal increases. In other words, larger deviations from the fair share are less attractive even if they provide higher monetary reward.

3. Mathematical form: Let S denote the monetary share to the participant and F the fairness ideal share determined by the relative token contribution. The utility can be defined as a weighted monetary gain minus a quadratic penalty on the deviation: 
  U = beta × S − alpha × (S − F)²

4. Parameters: There are two learnable parameters: 
  • beta: scaling the monetary benefit
  • alpha: weighting the penalty on deviating from fairness. 
Their bounds are set generously with non-negative values.

5. Mapping to observable behavior: In the dataset, for proposer trials, the observed behavior (the proposed split) determines the participant’s share. We calculate S using the variable proposed_perc (the percent offered to the opponent so that 100 − proposed_perc gives the self percent). The fairness ideal F is calculated using token_self and token_opp (F is proportional to the proportion of tokens found by the participant). The combined_earning is used to convert percentages into monetary terms. 

Below is the final formal specification.

<MODEL>
Let p denote the percentage proposed to the opponent (proposed_perc). Then the monetary share for the proposer is:
  S = ((100 − p)/100) × combined_earning

The fairness ideal share (in monetary terms) is given by:
  F = (token_self / (token_self + token_opp)) × combined_earning

The utility of a proposal is then:
  U = beta × S − alpha × (S − F)²
</MODEL>

